import React from "react";
import classes from '../css/Slider.module.css';
import SlideShow from "./SlideShow";
import ImagePreview from "./ImagePreview";

function Slider() {
    return(
        
        <>
            <SlideShow/>
            <ImagePreview/>
        </>
    );
}
export default Slider;
